import React, { Component } from "react";

class ProgressBar extends Component {
  render() {
    return (
      <div
        style={{
          width: `${this.props.width}%`,
          height: 50,
          backgroundColor: "red",
        }}
      ></div>
    );
  }
}

export default ProgressBar;
